  render () {
    return (
      <article>
        <div className="post-header">
          <img src={this.props.postData.image} alt="" />
          <h1>{this.props.postData.name} saaid...</h1>
        </div>
        <div className="post-body">
          {this.props.postData.body}
        </div>
        <div className="post-options">
          <ul>
            <li>edit post</li>
            <li>delete post</li>
          </ul>
        </div>
      </article>
    )
  }
}

